import Button from "./Button"
import Input from "./Input"

function Form() {
  return (
   <form className="flex flex-col " action="#" >
    <Input labelName="Name" forInput="inputName" typeInput="text" placeholderInput="e.g. Stephen King"/>
    <Input labelName="Address" forInput="inputMail" typeInput="email" placeholderInput="e.g. stephenking@lorem.com"/>
    <Input labelName="Phone Number" forInput="inputPhone" typeInput="tel" placeholderInput="e.g. +1 234 567 890"/>
    <Button />
   </form>
  )
}

export default Form
